Assigning a default value to a keyword argument in Python does not reassign everytime the function is called. Thus if your default value is a mutable object, it can be mutated every call.

The common way around this is as follows:

    class TestClass:
        def __init__(self, arr=None):
            self.arr = arr if arr is not None else []

