    public function linkable()
    {
        return $this->morphTo(null, App::make($this->linkable_type));
    }

This will not work in any case, because `morphTo()` in [Illuminate\Database\Eloquent\Model][1]
expects 

 1. The **name** of the polymorphic relationship ('linkable')
 2. The **type** of the object to be morphed ('Page', not an instance of `Page`)
 3. The **id** of the object to be morphed

If they are not provided, Laravel is smart enough to guess them and then accordingly return a `Illuminate\Database\Eloquent\MorphTo` object.

Also, `$this->linkable_type` and `$this->linkable_id` should actually not be `null` in that context.

Let's have a quick look at the relevant part of the `morphTo()` function:

    $instance = new $class;
    
    return new MorphTo(
        $instance->newQuery(), $this, $id, $instance->getKeyName(), $type, $name
    );

> **Note**: This is the code from version 4.2.6, the code linked above seems to be from a later version and is slightly different and the function returns a `BelongsTo` instead of a `MorphTo` object.

The problem is specifically the `$instance = new $class;` - the class is simply instanciated and not resolved. But you can just grab that part of the magic and handle it yourself:

    public function linkable()
    {
        $instance = App::make($this->linkable_type);

      	$id = 'linkable_id';
		$type = 'linkable_type';
		$name = 'linkable';

		return new MorphTo(
			$instance->newQuery(), $this, $id, $instance->getKeyName(), $type, $name
		);
    }

This should actually work (haven't tested it), but I'm not sure about any side effects it might cause in some edge cases.

Or maybe you could also just override the whole function in your `MenuItem`-model and just adjust the relevant part:

    public function morphTo($name = null, $type = null, $id = null)
    {
    	if (is_null($name))
    	{
    		list(, $caller) = debug_backtrace(false);
    
    		$name = snake_case($caller['function']);
    	}
    
    	list($type, $id) = $this->getMorphs($name, $type, $id);
    
        //eager loading
    	if (is_null($class = $this->$type))
    	{
    		return new MorphTo(
    			$this->newQuery(), $this, $id, null, $type, $name
    		);
    	}

        // normal lazy loading
    	else
    	{
            // this is the changed part
    		$instance = \App::make($class); // new $class;
    
    		return new MorphTo(
    			$instance->newQuery(), $this, $id, $instance->getKeyName(), $type, $name
    		);
    	}
    }

The relationship would then be as usual:

    public function linkable()
    {
        return $this->morphTo();
    }

> **Note**: This works well for lazy-loading, but does not work for eager-loading.  [An issue has been raised seeking a solution for eager-loading here.](https://github.com/laravel/framework/issues/5039)

  [1]: http://laravel.com/api/class-Illuminate.Database.Eloquent.Model.html

You can resize a modally-presented view with a custom UIStoryboardSegue. In the storyboard, set the segue to Custom instead of Modal. In the Segue Class, give it the name of your UIStoryboardSegue override.

To override UIStoryboardSegue, you won't need anything in your .h file. It will appear as something like this:

MyStoryboardSegue.h:

    #import <UIKit/UIKit.h>
    @interface MyStoryboardSegue : UIStoryboardSegue
    @end


In MyStoryboardSegue.m, the code would be:

    #import "MyStoryboardSegue.h"
    
    @implementation MyStoryboardSegue
    
    
    - (void)perform
    {
    	id sourceController = self.sourceViewController;
    	id destinationController = self.destinationViewController;
    	UIView *destinationView = [destinationController view];
    	CGFloat x, y, w, h;
    		
    	[destinationController setModalPresentationStyle:UIModalPresentationFormSheet];
    	[destinationController setModalTransitionStyle:UIModalTransitionStyleCrossDissolve];
    	[sourceController presentViewController:destinationController animated:YES completion:nil];

    /* 
    You have to present the view first, and then resize it. That's because,
    as far as I can tell, when you present your view modally, a new view is created
    that covers the screen in a black semi-transparent mask to give the shadow effect,
    and a container view is placed in the middle of this view that in turn holds the
    view you are presenting. Your view automatically resizes to the size of this
    container view, so that's the view you need to resize to make your view controller
    appear the size you desire. You must present your modal view first 
    because until you do, the container view doesn't exist. The following code
    resizes the container view (which is now your modal view's superview) and then
    resets the position of the container view to the center of the source view that
    is presenting the modal view so everything looks nice and centered.
    */
    	x = destinationView.superview.frame.origin.x;
    	y = destinationView.superview.frame.origin.y;
    	w = 400;  // Your desired modal view width
    	h = 400;  // Your desired modal view height
    	destinationView.frame = CGRectMake(x, y, w, h);
    	destinationView.center = [[sourceController view] center];
    }
    
    @end

